import React from 'react';
import { Link } from 'react-router-dom';
import styled, {css} from 'styled-components/macro'
import {FaBars} from 'react-icons/fa'
import '../css/Navbar.css';


const Nav = styled.nav`
  height: 60px;
  display: flex;
  justify-content: space-between;
  padding: 1rem 2rem;
  z-index: 100;
  position: fixed;
  width: 100%;
`;

const NavLink = css`
  color: #fff;
  display: flex;
  align-items: center;
  padding: 0 1rem;
  height: 100%
  cursor: pointer;
  text-decoration: none;
`;

const Logo = styled(Link)`
  ${NavLink}
  font-style: italic;
`;

const MenuBars = styled(FaBars)`
  display: none;

  @media screen and (max-width: 768px){
    display: block;
    color: white;
    cursor: pointer;
    transform: translate(-50%, 25%)
  }
`;

const NavMenu = styled.div`
  display: flex;
  align-items: center;
  margin-right: -48px;

  @media screen and (max-width: 768px) {
    display: none;
  }
`;

const NavMenuLinks = styled(Link)`
  ${NavLink}
`;

const Navbar = () => {
  return (
    <Nav>
      <Logo to="/">BantuKurir</Logo>
      <MenuBars />
      <NavMenu>
        <NavMenuLinks to="/input-tujuan">Input Tujuan</NavMenuLinks>
        <NavMenuLinks to="/cari-jalur">Cari Jalur</NavMenuLinks>
    </NavMenu>
    </Nav>
  )
}

export default Navbar;
